import React from 'react';
import './Car.css'

function Car({imgSrc, model, testDrive}) {
    return (
        <div className='car'>
            <div className="car__image">
                <img src={imgSrc} alt={model} />
            </div>
            <h2 className="car__model"></h2>
        </div>
    );
};

export default Car;
